import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Typography,
  Button,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import axios from 'axios';
import { API_ENDPOINTS } from '../config/api';

function ProductList() {
  const [products, setProducts] = useState([]);
  const [open, setOpen] = useState(false);
  const [newProduct, setNewProduct] = useState({
    product_name: '',
    product_category: '',
    product_price: '',
    product_image: '-',
  });

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await axios.get(API_ENDPOINTS.PRODUCTS);
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    setNewProduct({
      ...newProduct,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async () => {
    try {
      console.log('Submitting product:', newProduct);
      const response = await axios.post(API_ENDPOINTS.PRODUCTS, newProduct);
      console.log('Response:', response.data);
      fetchProducts();
      handleClose();
      setNewProduct({
        product_name: '',
        product_category: '',
        product_price: '',
        product_image: '-',
      });
    } catch (error) {
      console.error('Error creating product:', error);
      console.error('Error details:', error.response?.data);
    }
  };

  return (
    <Container className="mt-8">
      <Button
        variant="contained"
        onClick={handleOpen}
        className="mb-6 bg-blue-600 hover:bg-blue-700 transition-colors"
      >
        Add New Product
      </Button>
      <Grid container spacing={3}>
        {products.map((product) => (
          <Grid item xs={12} sm={6} md={4} key={product._id}>
            <Card className="shadow-lg hover:shadow-xl transition-shadow duration-300 rounded-lg">
              <CardMedia
                component="img"
                height="140"
                image={product.product_image}
                alt={product.product_name}
                className="object-cover rounded-t-lg"
              />
              <CardContent className="p-4">
                <Typography variant="h6" className="text-gray-800 font-semibold">
                  {product.product_name}
                </Typography>
                <Typography variant="body2" className="text-gray-500">
                  Category: {product.product_category}
                </Typography>
                <Typography variant="h6" className="text-blue-600 mt-2">
                  Rp {product.product_price}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Dialog open={open} onClose={handleClose} className="rounded-lg">
        <DialogTitle className="text-gray-800 font-semibold">Add New Product</DialogTitle>
        <DialogContent className="p-6">
          <TextField
            autoFocus
            margin="dense"
            name="product_name"
            label="Product Name"
            fullWidth
            value={newProduct.product_name}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
          <TextField
            margin="dense"
            name="product_category"
            label="Category"
            fullWidth
            value={newProduct.product_category}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
          <TextField
            margin="dense"
            name="product_price"
            label="Price"
            type="number"
            fullWidth
            value={newProduct.product_price}
            onChange={handleChange}
            className="bg-gray-50 rounded-lg"
          />
        </DialogContent>
        <DialogActions className="p-4">
          <Button
            onClick={handleClose}
            className="text-gray-600 hover:text-gray-800"
          >
            Cancel
          </Button>
          <Button
            onClick={handleSubmit}
            variant="contained"
            className="bg-blue-600 hover:bg-blue-700 transition-colors"
          >
            Add Product
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
}

export default ProductList;
